CREATE TABLE employees (
    employee_id INT PRIMARY KEY,
    employee_name STRING NOT NULL,
    access_level STRING NOT NULL
);

CREATE TABLE maintenance_tasks (
    task_id INT PRIMARY KEY,
    task_description STRING NOT NULL,
    completion_status BOOL NOT NULL,
    assigned_to INT REFERENCES employees(employee_id)
);

CREATE TABLE employees (
    employee_id INT PRIMARY KEY,
    employee_name VARCHAR(255) NOT NULL,
    access_level INT
);

CREATE TABLE tasks (
    task_id INT PRIMARY KEY,
    task_name VARCHAR(255) NOT NULL,
    task_description TEXT
);

CREATE TABLE Employees (
    employee_id INT PRIMARY KEY,
    employee_name VARCHAR(255),
    access_level INT,
    department VARCHAR(50)
);

CREATE TABLE AccessLog (
    log_id INT PRIMARY KEY,
    employee_id INT,
    login_time TIMESTAMP,
    logout_time TIMESTAMP
);

CREATE TABLE Departments (
    department_id INT PRIMARY KEY,
    department_name VARCHAR(50),
    head_employee_id INT,
    FOREIGN KEY (head_employee_id) REFERENCES Employees(employee_id) ON DELETE SET NULL
);
